#删除四张客户化表
DROP TABLE IF EXISTS TMP_HSBC_GFDR_PM_CLGRDKS;
DROP TABLE IF EXISTS TMP_HSBC_GFDR_PM_GRDKFSS;
DROP TABLE IF EXISTS tmp_hsbc_lmkm_dk_mapping;
DROP TABLE IF EXISTS tmp_hsbc_lmkm_fs_mapping;






CREATE TABLE TMP_HSBC_LMKM_DK_MAPPING(
LOAN_AC            VARCHAR(100) COMMENT'账号',
LOAN_LEVEL_CUST_NO VARCHAR(100) COMMENT'联名客户号',
SOLE_CUST_NO       VARCHAR(100) COMMENT'非联名客户号',
SXED_AMT           DECIMAL(22,2)COMMENT'联名授信额度',
SXED_AMT_CF        DECIMAL(22,2)COMMENT'拆分后的授信额度',
INDEX LOAN_AC_key(LOAN_AC),
INDEX LOAN_LEVEL_CUST_NO_KEY(LOAN_LEVEL_CUST_NO)

)COMMENT'存量个人贷款mapping表';
 

 

