CREATE TABLE TMP_HSBC_LMKM_FS_MAPPING(
LOAN_AC            VARCHAR(100) COMMENT'账号',
LOAN_LEVEL_CUST_NO VARCHAR(100) COMMENT'联名客户号',
SOLE_CUST_NO       VARCHAR(100) COMMENT'非联名客户号',
INDEX LOAN_AC_key(LOAN_AC),
INDEX LOAN_LEVEL_CUST_NO_KEY(LOAN_LEVEL_CUST_NO)

)COMMENT'个人贷款发生额mapping表';
  

 CREATE TABLE `TMP_HSBC_GFDR_PM_CLGRDKS` (
  `DATA_ID` VARCHAR(64) NOT NULL COMMENT '数据ID',
  `DATA_DATE` CHAR(8) DEFAULT NULL COMMENT '数据日期',
  `DATA_RPT_DATE` CHAR(8) DEFAULT NULL COMMENT '报表日期',
  `CORP_ID` VARCHAR(14) DEFAULT NULL COMMENT '法人机构号',
  `ORG_ID` VARCHAR(14) DEFAULT NULL COMMENT '机构号',
  `GROUP_ID` VARCHAR(100) DEFAULT NULL COMMENT '部门编号',
  `INQ_ORG_ID` VARCHAR(32) DEFAULT NULL COMMENT '查询机构号',
  `INQ_GROUP_ID` VARCHAR(32) DEFAULT NULL COMMENT '查询组号',
  `JRJGDM` VARCHAR(18) DEFAULT NULL COMMENT '金融机构代码',
  `NBJGH` VARCHAR(30) DEFAULT NULL COMMENT '内部机构号',
  `JRJGDQDM` VARCHAR(6) DEFAULT NULL COMMENT '金融机构地区代码',
  `JKRZJLX` VARCHAR(3) DEFAULT NULL COMMENT '借款人证件类型',
  `JKRZJDM` VARCHAR(60) DEFAULT NULL COMMENT '借款人证件代码',
  `JKRDQDM` VARCHAR(6) DEFAULT NULL COMMENT '借款人地区代码',
  `DKJJBM` VARCHAR(100) DEFAULT NULL COMMENT '贷款借据编码',
  `DKHTBM` VARCHAR(100) DEFAULT NULL COMMENT '贷款合同编码',
  `DKCPLB` VARCHAR(6) DEFAULT NULL COMMENT '贷款产品类别',
  `DKFFRQ_DATE` VARCHAR(8) DEFAULT NULL COMMENT '贷款发放日期',
  `DKDQRQ_DATE` VARCHAR(8) DEFAULT NULL COMMENT '贷款到期日期',
  `DKZQDQRQ_DATE` VARCHAR(8) DEFAULT NULL COMMENT '贷款展期到期日期',
  `BZ` VARCHAR(3) DEFAULT NULL COMMENT '币种',
  `DKYE_AMT` DECIMAL(22,2) DEFAULT NULL COMMENT '贷款余额',
  `DKYEZRMB_AMT` DECIMAL(22,2) DEFAULT NULL COMMENT '贷款余额折人民币',
  `LLSFGD` VARCHAR(4) DEFAULT NULL COMMENT '利率是否固定',
  `LLSP` DECIMAL(15,5) DEFAULT NULL COMMENT '利率水平',
  `DKDJJZLX` VARCHAR(4) DEFAULT NULL COMMENT '贷款定价基准类型',
  `JZLL` DECIMAL(15,5) DEFAULT NULL COMMENT '基准利率',
  `DKCZFCFS` VARCHAR(5) DEFAULT NULL COMMENT '贷款财政扶持方式',
  `DKLLCXDJR_DATE` VARCHAR(8) DEFAULT NULL COMMENT '贷款利率重新定价日',
  `DKDBFS` VARCHAR(3) DEFAULT NULL COMMENT '贷款担保方式',
  `SFSCDK` VARCHAR(1) DEFAULT NULL COMMENT '是否首次贷款',
  `DKZL` VARCHAR(4) DEFAULT NULL COMMENT '贷款质量',
  `DKZT` VARCHAR(4) DEFAULT NULL COMMENT '贷款状态',
  `YQLX` VARCHAR(2) DEFAULT NULL COMMENT '逾期类型',
  `DKYT` VARCHAR(1000) DEFAULT NULL COMMENT '贷款用途',
  `REMARKS` VARCHAR(14) DEFAULT NULL COMMENT '备注',
  `CHECK_FLAG` CHAR(1) DEFAULT NULL COMMENT '校验标识',
  `CHECK_DESC` VARCHAR(3072) DEFAULT NULL COMMENT '校验结果',
  `CHECK_ERR_TYPE` CHAR(1) DEFAULT NULL COMMENT '校验失败类型',
  `NEXT_ACTION` CHAR(2) DEFAULT NULL COMMENT '下一动作',
  `DATA_STATUS` CHAR(2) DEFAULT NULL COMMENT '数据状态',
  `DATA_FLAG` CHAR(1) DEFAULT NULL COMMENT '数据是否已删除',
  `DATA_OP` CHAR(1) DEFAULT NULL COMMENT '数据操作 A：新增，D:删除, M:修改',
  `DATA_SOURCE` CHAR(1) DEFAULT NULL COMMENT '数据来源',
  `DATA_VERSION` INT(11) DEFAULT NULL COMMENT '数据版本',
  `DATA_REJ_DESC` VARCHAR(128) DEFAULT NULL COMMENT '数据审核拒绝原因',
  `DATA_DEL_DESC` VARCHAR(128) DEFAULT NULL COMMENT '数据删除描述',
  `DATA_CRT_USER` VARCHAR(20) DEFAULT NULL COMMENT '数据创建/导入用户',
  `DATA_CRT_DATE` CHAR(8) DEFAULT NULL COMMENT '数据创建/导入日期',
  `DATA_CRT_TIME` CHAR(14) DEFAULT NULL COMMENT '数据创建/导入时间',
  `DATA_CHG_USER` VARCHAR(20) DEFAULT NULL COMMENT '数据修改/删除用户',
  `DATA_CHG_DATE` CHAR(8) DEFAULT NULL COMMENT '数据修改/删除日期',
  `DATA_CHG_TIME` CHAR(14) DEFAULT NULL COMMENT '数据修改/删除时间',
  `DATA_APV_USER` VARCHAR(20) DEFAULT NULL COMMENT '数据审核/拒绝用户',
  `DATA_APV_DATE` CHAR(8) DEFAULT NULL COMMENT '数据审核/拒绝日期',
  `DATA_APV_TIME` CHAR(14) DEFAULT NULL COMMENT '数据审核/拒绝时间',
  `RSV1` VARCHAR(180) DEFAULT NULL COMMENT '备用1',
  `RSV2` VARCHAR(180) DEFAULT NULL COMMENT '备用2',
  `RSV3` VARCHAR(180) DEFAULT NULL COMMENT '备用3',
  `RSV4` VARCHAR(180) DEFAULT NULL COMMENT '备用4',
  `RSV5` VARCHAR(180) DEFAULT NULL COMMENT '备用5',
  	 PRIMARY KEY (DATA_ID),
	 UNIQUE KEY U_CLGRDK (DATA_RPT_DATE,JRJGDM,DKJJBM),
	 INDEX DKHTBM_KEY(DKHTBM),
	 INDEX RSV1_KEY(RSV1),
	 INDEX JKRZJDM_KEY(JKRZJDM)
) ENGINE=INNODB DEFAULT CHARSET=utf8;





